    // </BrowserRouter>

    <div>
        <p>Viagens</p>
        <BrowserRouter>
        <Switch>
        <Route exact path={"/"}>
            <HomePage/>
        </Route>
        
        <Route exact path={"/trips/:list"}>
            <ListTripsPage/>
        </Route>
       
        <Route exact path={"/trips-application"}>
            <ApplicationFormPage/>
        </Route>

        <Route exact path={"/admin-trips-list"}>
            <AdminHomePage/>
        </Route>

        <Route exact path={"/login"}>
            <LoginPage/>
        </Route>

        <Route exact path={"/admin/trips/:id"}>
            <TripDetailsPage/>
        </Route>

        <Route exact path={"/admin-trips-create"}>
            <CreateTripPage/>
        </Route>

        </Switch>
        
        
        </BrowserRouter>
    </div>

    )

}
